INSERT INTO `bigtree_pages` (`id`, `trunk`, `parent`, `in_nav`, `nav_title`, `route`, `path`, `title`, `meta_description`, `seo_invisible`, `template`, `external`, `new_window`, `resources`, `archived`, `archived_inherited`, `publish_at`, `expire_at`, `max_age`, `last_edited_by`, `ga_page_views`, `position`, `created_at`, `updated_at`) VALUES (0, '', -1, 'on', 'Timber', '', '', 'Timber Lumberjack Co', '', '',  'home', '', '', '{\n    \"page_header\": \"{Cutting} down a big tree? Leave it to the {professionals}.\",\n    \"page_image\": \"//s3.amazonaws.com/bigtree-demo-site/files/pages/20160421-fastspot-0075.jpg\",\n    \"callouts_full\": [\n        {\n            \"type\": \"full-callout\",\n            \"display_title\": \"Meet the Lumberjacks\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0149.jpg\",\n            \"heading\": \"Meet the Lumberjacks\",\n            \"blurb\": \"<p>They\'re strong. They\'re affable. And darn they\'re good-lookin\'. We\'ll connect you with\\u00a0one of the top lumber\\u00a0ninjas this side of the Mississippi. All you have to do is provide the pancakes.\\u00a0</p>\",\n            \"link_title\": \"Take A Look\",\n            \"link_url\": \"ipl://2//W10=////\"\n        },\n        {\n            \"type\": \"full-news\",\n            \"display_title\": \"Recent News\",\n            \"heading\": \"Recent News\"\n        }\n    ]\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:16:04', '2018-10-19 11:51:26'), (1, '', 0, 'on', 'About Us', 'about-us', 'about-us', 'About Us', '', '',  'content', '', '', '{\"page_header\":\"About Us\",\"page_image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/pages\\/20160421-fastspot-0088.jpg\",\"page_intro\":\"Two weeks before a big ol\\u2019 tree fell on her house, our founder Robin Cedar noticed the tree was aging and got worried, but she just didn\\u2019t know who to call. Less than a year later, she\\u2019d filed the papers to found Timber, so no one would find themselves without a quality lumberjack again.\",\"page_content\":\"<p class=\\\"p1\\\"><span class=\\\"s1\\\">We&rsquo;ve all been there. Flipping through the phonebook, all those cut-rate lumberjacks just waiting to empty your pockets for subpar work. No more!<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\">Timber does away with the guess work. Request one of our highly qualified lumber strategists, or have us pick one suited to your needs. Then you can rest your mind, confident the work will be done right, quickly, and for a fair price.&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\">At Timber we value three things: quality, safety, and the happiness of our customers. Also pancakes. So four things. We pride ourselves on having a long record of satisfied customers. But don&rsquo;t take our word for it. Happy customer and little-known actor Spruce Willis said, &ldquo;Just after moving into my new house, the aging trees in the backyard were the last thing I had time to deal with. Timber sent out a couple of their amazing lumber alchemists, and the whole job was done in less than a day. Yippee ki yay!&rdquo; Thanks, Spruce!<\\/span><\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><em>None of this is true. This is just an example of a page that uses a <\\/em><a href=\\\"https:\\/\\/www.bigtreecms.org\\/docs\\/dev-guide\\/templates\\/\\\"><span class=\\\"s2\\\"><em>basic template<\\/em><\\/span><\\/a><em>, some page content, and a <\\/em><a href=\\\"https:\\/\\/www.bigtreecms.org\\/docs\\/dev-guide\\/callouts\\/\\\"><span class=\\\"s2\\\"><em>callout<\\/em><\\/span><\\/a><em>. Go to the <\\/em><a href=\\\"https:\\/\\/www.bigtreecms.org\\/docs\\/dev-guide\\/installation\\/\\\"><span class=\\\"s2\\\"><em>BigTree Developer Guide<\\/em><\\/span><\\/a><em> for more.<\\/em><\\/span><\\/p>\",\"callouts_content\":[{\"type\":\"content-callout\",\"display_title\":\"Jack Plaid\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0090.jpg\",\"heading\":\"Jack Plaid\",\"blurb\":\"<p>Troublemaker. Lifelong beard lover. Climber. Poet. Avid mulch buff. Jogging guru. Music practitioner.<\\/p>\",\"link_title\":\"Take A Look\",\"link_url\":\"#\"},{\"type\":\"content-callout\",\"display_title\":\"Fawn Forrest\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0008.jpg\",\"heading\":\"Fawn Forrest\",\"blurb\":\"<p>Organizer. Evil food advocate. Bark fanatic. Coffee guru. Hipster-friendly beer practitioner. Passionate communicator. Soil fan. Reader.<\\/p>\",\"link_title\":\"Take A Look\",\"link_url\":\"#\"}],\"callouts_full\":[{\"type\":\"full-gallery\",\"display_title\":\"Lumberjacks Hard at Work\",\"heading\":\"Lumberjacks Hard at Work\",\"images\":[{\"caption\":\"Amet Parturient Ornare Fermentum\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0181.jpg\"},{\"caption\":\"Purus Pellentesque Condimentum\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0024.jpg\"},{\"caption\":\"Tortor Adipiscing Fermentum Pharetra\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0071.jpg\"}]}],\"callouts_sidebar\":[{\"type\":\"sidebar-callout\",\"display_title\":\"Latest News\",\"image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/callouts\\/20160421-fastspot-0096.jpg\",\"heading\":\"Latest News\",\"blurb\":\"<p>Find out what\'s going on at Timber, and get some helpful tree tips.<\\/p>\",\"link_title\":\"Check It Out\",\"link_url\":\"ipl:\\/\\/4\\/\\/W10=\"}]}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:25:50', '2016-08-12 15:27:17'), (2, '', 0, 'on', 'Our Lumberjacks', 'our-lumberjacks', 'our-lumberjacks', 'Our Lumberjacks', '', '',  'content', '', '', '{\n    \"page_header\": \"Our Lumberjacks\",\n    \"page_image\": \"\",\n    \"page_intro\": \"\",\n    \"page_content\": \"<p>&nbsp;<span class=\\\"s1\\\"><em>These people are ridiculous and fake. This page is an example of a </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/templates/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>basic template</em></span></a><em> with page content and a set of </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/callouts/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>callouts</em></span></a><em>. Go to the </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/installation/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>\",\n    \"callouts_content\": [\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Jack Plaid\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0090-4.jpg\",\n            \"heading\": \"Jack Plaid\",\n            \"blurb\": \"<p>Troublemaker. Lifelong beard lover. Climber. Poet. Avid mulch buff. Jogging guru. Music practitioner.</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        },\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Angus Flint\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0002.jpg\",\n            \"heading\": \"Angus Flint\",\n            \"blurb\": \"<p>Branch advocate. Chopaholic. General saw ninja. Evil gamer. Student. Devoted coffee scholar.</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        },\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Fawn Forrest\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0008-2.jpg\",\n            \"heading\": \"Fawn Forrest\",\n            \"blurb\": \"<p>Organizer. Evil food advocate. Bark fanatic. Coffee guru. Hipster-friendly beer practitioner. Passionate communicator. Soil fan. Reader.</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        },\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Amber Pine\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0044.jpg\",\n            \"heading\": \"Amber Pine\",\n            \"blurb\": \"<p>Arboreal scholar. Certified explorer. Analyst. Amateur food fan. Shrub fanatic. Weed buff, not that kind of weed, which one were you thinking about?</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        },\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Huck Bunyan\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0024-2.jpg\",\n            \"heading\": \"Huck Bunyan\",\n            \"blurb\": \"<p>General zombie buff. Typical introvert. Award-winning sustainability advocate. Bacon nerd. Leaf lover.</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        },\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Brooke \\u2018The Axe\\u2019 Acker\",\n            \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0037.jpg\",\n            \"heading\": \"Brooke \\u2018The Axe\\u2019 Acker\",\n            \"blurb\": \"<p>Stick enthusiast. Award-winning travel maven. Professional flannel junkie. Bird watcher. Writer.</p>\",\n            \"link_title\": \"\",\n            \"link_url\": \"\"\n        }\n    ],\n    \"callouts_full\": [],\n    \"callouts_sidebar\": []\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:26:02', '2018-10-19 11:42:17'), (3, '', 0, 'on', 'Work With Us', 'work-with-us', 'work-with-us', 'Work With Us', '', '',  'content', '', '', '{\n    \"page_header\": \"Work With Us\",\n    \"page_image\": \"\",\n    \"page_intro\": \"\",\n    \"page_content\": \"<p class=\\\"p1\\\"><span class=\\\"s1\\\">Are you disciplined, passionate about trees, and really cool to hang out with? We&rsquo;re always looking for new lumber rock stars. Contact us to begin the rigorous onboarding process.</span></p>\\r\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><em>Ok, we are not really looking for lumber rock stars because none of this is real. But if you&rsquo;re interested in BigTree, the CMS powering this demo, stay in touch! Follow us on </em><a href=\\\"https://twitter.com/bigtreecms?lang=en\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>Twitter</em></span></a><em>, subscribe to the </em><a href=\\\"https://www.bigtreecms.org/download/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>newsletter</em></span></a><em>, or say hi on the </em><a href=\\\"https://www.bigtreecms.org/forum/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>forum</em></span></a><em>. And we&rsquo;re always on the lookout for great BigTree developers to add to our list of </em><a href=\\\"https://www.bigtreecms.org/trusted-developers/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>trusted developers</em></span></a><em>.</em></span></p>\",\n    \"callouts_content\": [],\n    \"callouts_full\": [\n        {\n            \"type\": \"full-gallery\",\n            \"display_title\": \"Gallery\",\n            \"heading\": \"\",\n            \"images\": [\n                {\n                    \"caption\": \"Flannel pariatur ramps, trust fund chicharrones eiusmod mumblecore bespoke \",\n                    \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0074.jpg\"\n                },\n                {\n                    \"caption\": \"Kale chips selvage sunt cray, quis proident irure velit\",\n                    \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0133.jpg\"\n                },\n                {\n                    \"caption\": \"Narwhal seitan put a bird on it tote bag\",\n                    \"image\": \"//s3.amazonaws.com/bigtree-demo-site/files/callouts/20160421-fastspot-0032.jpg\"\n                }\n            ]\n        }\n    ],\n    \"callouts_sidebar\": []\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:26:13', '2018-10-19 11:38:44'), (4, '', 0, '', 'News', 'news', 'news', 'News', '', '',  'news', '', '', '{\"page_image\":\"\\/\\/s3.amazonaws.com\\/bigtree-demo-site\\/files\\/pages\\/20160421-fastspot-0124.jpg\"}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:26:24', '2016-08-08 14:40:55'), (5, '', 0, '', 'Newsletter', 'newsletter', 'newsletter', 'Newsletter', '', '',  'content', '', '', '{\"page_header\":\"Newsletter\",\"page_image\":\"\",\"page_intro\":\"\",\"page_content\":\"<p>Looking to stay hip to the latest business, gossip, and hot tips in the lumberjack industry? Look no further than the daily Timber newsletter.&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\"><span class=\\\"s1\\\"><em>There is no such newsletter. But if you&rsquo;re interested in the latest updates and upcoming features to BigTree CMS, there is a newsletter for that. We only send it out monthly, so it&rsquo;s a great way to stay up to date without getting overwhelmed.<\\/em><\\/span><\\/p>\",\"callouts_content\":[],\"callouts_full\":[],\"callouts_sidebar\":[{\"type\":\"sidebar-callout\",\"display_title\":\"Other Ways to Get Involved\",\"image\":\"\",\"heading\":\"Other Ways to Get Involved\",\"blurb\":\"<p><span class=\\\"s1\\\">Become a part of the Timber\\/BigTree community.<\\/span><\\/p>\",\"link_title\":\"Work With Us\",\"link_url\":\"ipl:\\/\\/3\\/\\/W10=\"}]}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:26:43', '2016-08-12 16:07:16'), (6, '', 0, '', 'Contact Us', 'contact-us', 'contact-us', 'Contact Us', '', '',  'content', '', '', '{\n    \"page_header\": \"Contact Us\",\n    \"page_image\": \"\",\n    \"page_intro\": \"\",\n    \"page_content\": \"<p class=\\\"p1\\\"><span class=\\\"s1\\\">Need help with your lumber problem? Have a question about how Timber works? Got a great tree-related joke? Drop us a line!&nbsp;</span></p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\">Phone: 555-LUM-BERR</span></p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\">Fax: 555-123-4567</span></p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\">Address: 0987 Oak Ave<br />Elm City, MD 11111</span></p>\\r\\n<p class=\\\"p1\\\">&nbsp;</p>\\r\\n<p class=\\\"p1\\\"><span class=\\\"s1\\\"><em>This page is an example of a </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/templates/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>basic template</em></span></a><em> with page content and a set of </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/callouts/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>callouts</em></span></a><em>. Go to the </em><a href=\\\"https://www.bigtreecms.org/docs/dev-guide/installation/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><span class=\\\"s2\\\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>\",\n    \"callouts_content\": [\n        {\n            \"type\": \"content-callout\",\n            \"display_title\": \"Work With Us\",\n            \"image\": \"\",\n            \"heading\": \"Work With Us\",\n            \"blurb\": \"<p>Interested in a job? Apply for a job as a lumber guru! Rewarding jobs, unlimited pancakes.</p>\",\n            \"link_title\": \"Work With Us\",\n            \"link_url\": \"ipl://3//W10=////\"\n        }\n    ],\n    \"callouts_full\": [],\n    \"callouts_sidebar\": []\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:26:56', '2018-10-19 11:50:34'), (7, '', 1, 'on', 'Our Tree-Free Guarantee', 'our-tree-free-guarantee', 'about-us/our-tree-free-guarantee', 'Our Tree-Free Guarantee', '', '',  'content', '', '', '{\n    \"page_header\": \"Our Tree-Free Guarantee\",\n    \"page_image\": \"\",\n    \"page_intro\": \"\",\n    \"page_content\": \"<p>Lorem ipsum dolor amet man braid yr raw denim bitters. Roof party everyday carry woke distillery enamel pin fixie try-hard irony brunch vexillologist. Hot chicken copper mug VHS slow-carb, leggings enamel pin bespoke tumblr sriracha viral lumbersexual semiotics. Mumblecore XOXO keffiyeh franzen hammock adaptogen farm-to-table crucifix roof party chicharrones.</p>\\r\\n<p>Gentrify unicorn drinking vinegar, kickstarter bushwick PBR&amp;B crucifix edison bulb affogato. Retro hoodie hexagon actually chia, keffiyeh migas master cleanse health goth crucifix lumbersexual gluten-free you probably haven\'t heard of them adaptogen. Yr godard cold-pressed venmo af, YOLO enamel pin bitters portland vegan truffaut hell of trust fund banh mi shaman. Hashtag neutra shaman marfa umami. 3 wolf moon migas typewriter art party gastropub offal master cleanse celiac twee.</p>\\r\\n<p>Street art portland shoreditch kale chips narwhal trust fund man bun cray sustainable. Live-edge blue bottle pok pok activated charcoal vegan pork belly try-hard before they sold out snackwave ennui you probably haven\'t heard of them leggings single-origin coffee. Seitan chartreuse normcore pug, chillwave freegan tousled vexillologist craft beer bitters YOLO. Shoreditch echo park drinking vinegar before they sold out synth subway tile, gastropub dreamcatcher. Etsy post-ironic organic twee coloring book iceland ramps squid pour-over. Blue bottle locavore bicycle rights enamel pin asymmetrical thundercats pour-over direct trade. Art party fashion axe coloring book poutine meditation twee.</p>\",\n    \"callouts_content\": [],\n    \"callouts_full\": [],\n    \"callouts_sidebar\": []\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:27:20', '2018-10-19 11:48:24'), (8, '', 1, 'on', 'How It All Started', 'how-it-all-started', 'about-us/how-it-all-started', 'How It All Started', '', '',  'content', '', '', '{\n    \"page_header\": \"How It All Started\",\n    \"page_image\": \"\",\n    \"page_intro\": \"\",\n    \"page_content\": \"<p>Lorem ipsum dolor amet ennui prism synth forage man bun intelligentsia dreamcatcher next level viral. Craft beer williamsburg 3 wolf moon gluten-free. Chillwave iceland waistcoat drinking vinegar you probably haven\'t heard of them ethical sustainable gochujang etsy brooklyn. Put a bird on it green juice yuccie, dreamcatcher air plant coloring book kinfolk VHS lomo messenger bag portland thundercats beard health goth. Cornhole prism try-hard, dreamcatcher raw denim keffiyeh gentrify affogato butcher tilde. Vaporware stumptown banh mi tilde ennui paleo selfies, hoodie freegan.</p>\\r\\n<p>Brooklyn flannel cornhole taxidermy, migas pinterest quinoa narwhal. Literally mixtape lyft chambray ugh jianbing, keytar pinterest distillery direct trade stumptown raw denim franzen. 90\'s next level ramps artisan, lomo retro hexagon shaman pitchfork. Meh pork belly locavore knausgaard literally umami squid man braid echo park kinfolk roof party shoreditch yuccie yr. Wayfarers sriracha artisan, four loko drinking vinegar cliche celiac.</p>\",\n    \"callouts_content\": [],\n    \"callouts_full\": [],\n    \"callouts_sidebar\": []\n}', '', '', NULL, NULL, 0, 1, 0, 0, '2016-05-02 13:27:27', '2018-10-19 11:48:41'), (9, '', 8, 'on', 'Our Founding Jacks', 'our-founding-jacks', 'about-us/how-it-all-started/our-founding-jacks', 'Our Founding Jacks', '', '',  'content', '', '', '{\n    \"page_header\": \"Our Founding Jacks\",\n    \"page_image\": \"\",\n    \"page_intro\": \"Lorem ipsum dolor amet glossier wayfarers shaman biodiesel direct trade, scenester church-key poke. Polaroid before they sold out vape, poutine coloring book scenester fam put a bird on it shabby chic subway tile.\",\n    \"page_content\": \"<p>Occupy pop-up lomo kitsch copper mug bicycle rights everyday carry kogi chi