CREATE TABLE `timber_news` ( `id` int(11) unsigned NOT NULL AUTO_INCREMENT, `title` varchar(255) DEFAULT NULL, `route` varchar(255) DEFAULT NULL, `date` datetime DEFAULT NULL, `image` varchar(255) DEFAULT NULL, `blurb` text, `content` text, PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;
INSERT INTO `timber_news` (`id`, `title`, `route`, `date`, `image`, `blurb`, `content`) VALUES (1, 'How To Tell if Your Tree is About to Fall Down', 'how-to-tell-if-your-tree-is-about-to-fall-down', '2016-04-16 00:00:00', '//s3.amazonaws.com/bigtree-demo-site/files/modules/20160421-fastspot-0127.jpg', 'Is that old tree a beautiful part of your lawn or a danger to your house and your family? Use these 6 handy tricks to find out if you need to call up one of our lumber artisans.', '<p class=\"p1\"><span class=\"s1\">Is that old tree a beautiful part of your lawn or a danger to your house and your family? Use these 6 handy tricks to find out if you need to call up one of our lumber artisans.</span></p>\r\n<p class=\"p1\">&nbsp;</p>\r\n<h3 class=\"p1\"><span class=\"s1\">1. It&rsquo;s leaning a lot</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">That tree&rsquo;s leaning. How long until it falls? Don&rsquo;t wait to find out. Take it down.</span></p>\r\n<h3 class=\"p1\"><span class=\"s1\">2. There are a bunch of cracks at the base</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">Hey dude. That tree&rsquo;s fixin&rsquo; to break. That&rsquo;s bad. Call us.</span></p>\r\n<h3 class=\"p1\"><span class=\"s1\">3. The tree has multiple trunks</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">That&rsquo;s real unstable, friend. Nip it in the bud.</span></p>\r\n<h3 class=\"p1\"><span class=\"s1\">4. It got struck by lightning</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">Yea, red flag. Shut it down.</span></p>\r\n<h3 class=\"p1\"><span class=\"s1\">5. It&rsquo;s literally falling down right now</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">This is a pretty consistent sign your tree&rsquo;s coming down.</span></p>\r\n<h3 class=\"p1\"><span class=\"s1\">6. A Timber lumberjack just parked out front</span></h3>\r\n<p class=\"p1\"><span class=\"s1\">Yea, that tree&rsquo;s coming down, for sure. But don&rsquo;t worry about it, we&rsquo;ve got it handled.</span></p>\r\n<p class=\"p1\">&nbsp;&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\"><em>We are clearly not actual tree experts. This page is generated by a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/templates/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>routed template</em></span></a><em>. It makes use of a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/modules/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>module</em></span></a><em> that allows for portable content with multiple views. Go to the </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/installation/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>'), (2, 'You Won\'t Believe How Many People Are Killed by Trees Every Year', 'you-won-t-believe-how-many-people-are-killed-by-trees-every-year', '2016-04-08 00:00:00', '', 'Trees are wonderful. They give us life. But sometimes they take life away.', '<p class=\"p1\"><span class=\"s1\">There are over 100 tree-related deaths every year. Can you believe it? You probably can&rsquo;t.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\"><em>But you should. That is one of the few true things on this website. This page is generated by a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/templates/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>routed template</em></span></a><em>. It makes use of a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/modules/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>module</em></span></a><em> that allows for portable content with multiple views. &nbsp;Go to the </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/installation/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>'), (4, 'Green Lumberjacks: How Timber Promotes Sustainability', 'green-lumberjacks-how-timber-promotes-sustainability', '2016-03-20 00:00:00', '//s3.amazonaws.com/bigtree-demo-site/files/modules/20160421-fastspot-0128.jpg', 'Donec ullamcorper nulla non metus auctor fringilla. Maecenas sed diam eget risus varius blandit sit amet non magna. Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor. Maecenas sed diam eget risus varius blandit sit amet non magna.', '<p class=\"p1\"><span class=\"s1\">Heirloom gastropub blue bottle venmo paleo. YOLO chicharrones sartorial banjo plaid, photo booth green juice kombucha taxidermy put a bird on it crucifix roof party mumblecore ramps dreamcatcher. VHS ugh thundercats lo-fi, wayfarers gluten-free butcher yr flexitarian salvia. Bitters taxidermy wayfarers tousled meditation, pork belly YOLO 3 wolf moon fap chambray marfa actually freegan mixtape. Meggings bushwick wayfarers, tacos tumblr paleo selvage narwhal gentrify williamsburg messenger bag 90\'s. Trust fund echo park godard, shabby chic gentrify bitters offal. VHS lomo green juice art party marfa leggings 8-bit.</span></p>\r\n<p><span class=\"s1\">Fanny pack heirloom messenger bag freegan, wolf bitters squid. Venmo leggings chambray cred, brooklyn deep v beard man braid mlkshk microdosing. Chartreuse single-origin coffee man bun, shoreditch neutra pour-over chillwave pork belly affogato wayfarers organic beard taxidermy migas chicharrones. Kitsch whatever keytar sustainable, blue bottle artisan distillery fap selfies tattooed swag schlitz freegan. Viral next level affogato roof party. Ugh chambray cred meditation. Umami church-key retro you probably haven\'t heard of them franzen pinterest.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\"><em>This page is generated by a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/templates/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>routed template</em></span></a><em>. It makes use of a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/modules/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>module</em></span></a><em> that allows for portable content with multiple views. Go to the </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/installation/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>'), (5, 'One of Timber&rsquo;s Finest Wins Axe Chuckin&rsquo; Contest', 'one-of-timber-s-finest-wins-axe-chuckin-contest', '2016-03-16 00:00:00', '', 'Huck Bunyan took first place in the axe throwing contest at the Oakwood Outdoor Festival.', '<p class=\"p1\"><span class=\"s1\">Huck Bunyan took first place in the axe throwing contest at the Oakwood Outdoor Festival. While he probably won&rsquo;t have to chuck any axes in his work for Timber, it&rsquo;s nice to know he could.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">To learn more about Huck and his fellow jacks, meet <a href=\"ipl://2//W10=////\">Our Lumberjacks</a>.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\"><em>There is no such festival, of course. This page is generated by a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/templates/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>routed template</em></span></a><em>. It makes use of a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/modules/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>module</em></span></a><em> that allows for portable content with multiple views. Go to the </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/installation/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>'), (6, 'Uber for Trees: Timber brings lumberjacks to your door', 'uber-for-trees-timber-brings-lumberjacks-to-your-door', '2016-02-15 00:00:00', '//s3.amazonaws.com/bigtree-demo-site/files/modules/20160421-fastspot-0140.jpg', 'After a successful beta period, Timber is launching worldwide.', '<p class=\"p1\"><span class=\"s1\">After a successful beta period, Timber is launching worldwide.&nbsp;Using cutting edge technology, we connect you to top quality lumberjacks for a fraction of the price.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">For too long, the process of finding a reputable and reliable lumberjack has been daunting and expensive. The founders of Timber saw this as fertile ground for disruption. The lumber industry will never be the same.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"p2\"><span class=\"s1\"><em>This page is generated by a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/templates/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>routed template</em></span></a><em>. It makes use of a </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/modules/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>module</em></span></a><em> that allows for portable content with multiple views. Go to the </em><a href=\"https://www.bigtreecms.org/docs/dev-guide/installation/\" target=\"_blank\" rel=\"noopener\"><span class=\"s2\"><em>BigTree Developer Guide</em></span></a><em> for more.</em></span></p>');

